import React from 'react';
import { Context
 } from './Home';
 
function PostDescription() {
    return (
        <div>
            <Context.Consumer>
           {   (value)=> {
              <div>
             <h1 id="center">Post PostDescription</h1> 
             <h1>{value}</h1>
             </div>
                      }}
           </Context.Consumer>
        </div>
    );
}

export default PostDescription;
